class Point{
    constructor(x, y){
        this.x = x;
        this.y = y;
        this.r = Math.floor(Math.random(1)*255);
        this.g = Math.floor(Math.random(1)*255);
        this.b = Math.floor(Math.random(1)*255);
    }
}

export default Point;
